  `customercompname` varchar(100) DEFAULT NULL COMMENT '客户公司名称',
  `customercompsizeid` int(11) DEFAULT NULL COMMENT '客户公司规模id',
  `customercompsize` varchar(30) DEFAULT NULL COMMENT '客户公司规模',
  `customername` varchar(30) DEFAULT NULL COMMENT '客户姓名',
  `customerposition` varchar(50) DEFAULT NULL COMMENT '客户职位',
