  `recommenddescribe` varchar(50) DEFAULT NULL COMMENT '推荐客户说明',
  `recommendfile` varchar(100) DEFAULT NULL COMMENT '需求附件',
  `recommendtime` datetime DEFAULT NULL COMMENT '商机推荐时间',
  `issuserid` int(11) DEFAULT NULL COMMENT '发布人id',
  `status` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=193 DEFAULT CHARSET=utf8 COMMENT='商机表';

