  `oppname` varchar(60) DEFAULT NULL COMMENT '商机名称',
  `confirmtime` datetime DEFAULT NULL COMMENT '确认时间',
  `paymenttime` datetime DEFAULT NULL COMMENT '支付时间',
  `issuserid` int(11) DEFAULT NULL COMMENT '推荐人id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=231 DEFAULT CHARSET=utf8 COMMENT='商机推荐表';

