/*Table structure for table `st_resume_trash` */

DROP TABLE IF EXISTS `st_resume_trash`;

CREATE TABLE `st_resume_trash` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `fullname` varchar(30) DEFAULT NULL,
  `tel` varchar(11) DEFAULT NULL,
  `sex` smallint(1) DEFAULT NULL,
  `age` int(2) DEFAULT NULL,
  `highestdegree` varchar(30) DEFAULT NULL,
  `education` varchar(100) DEFAULT NULL,
  `currentlocation` varchar(100) DEFAULT NULL,
  `email` varchar(100) DEFAULT NULL,
  `worktime` varchar(30) DEFAULT NULL,
  `company` varchar(50) DEFAULT NULL,
  `position` varchar(50) DEFAULT NULL,
  `nowmoney` varchar(50) DEFAULT NULL,
  `keyword` varchar(100) DEFAULT NULL,
  `keywordmessage` varchar(100) DEFAULT NULL,
  `curindustry` varchar(50) DEFAULT NULL,
  `uploadtime` datetime DEFAULT NULL,
  `intentionjob` varchar(50) DEFAULT NULL,
  `isworking` smallint(1) DEFAULT NULL,
  `marryed` smallint(1) DEFAULT NULL,
  `uploadby` int(11) DEFAULT NULL,
  `url` varchar(100) DEFAULT NULL,
  `status` int(11) DEFAULT NULL COMMENT '是否审核通过  0是刚上传             1是审核通过             9是被过滤程序过滤',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='(简历垃圾表)用于存放分析合理，但是库中已存在的简历';

/*Data for the table `st_resume_trash` */

/*Table structure for table `st_web_user` */

DROP TABLE IF EXISTS `st_web_user`;

CREATE TABLE `st_web_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `logo` varchar(100) DEFAULT NULL,
  `nickname` varchar(30) DEFAULT NULL COMMENT '个人用户是昵称或企业用户是公司名称',
  `phone` varchar(11) NOT NULL COMMENT '电话',
  `recipient` varchar(30) DEFAULT NULL COMMENT '收款人',
  `banktype` varchar(30) DEFAULT NULL COMMENT '银行类型',
  `cardno` varchar(20) DEFAULT NULL COMMENT '银行卡号',
  `password` varchar(20) NOT NULL COMMENT '密码',
  `qq` varchar(20) DEFAULT NULL COMMENT 'qq',
  `wechat` varchar(20) DEFAULT NULL COMMENT '微信',
  `email` varchar(20) DEFAULT NULL,
  `recommendcode` varchar(20) DEFAULT NULL,
  `type` int(11) NOT NULL COMMENT '0表示个人用户；1表示企业用户；2后台',
  `companyname` varchar(100) DEFAULT '' COMMENT '公司名称',
  `industryid` int(11) DEFAULT NULL COMMENT '公司行业',
  `website` varchar(20) DEFAULT NULL,
  `intro` longtext COMMENT '企业介绍',
  `insize` varchar(30) DEFAULT NULL COMMENT '企业规模',
  `specialty` varchar(30) DEFAULT NULL,
  `score` double DEFAULT NULL COMMENT '当前积分',
  `status` int(11) DEFAULT NULL COMMENT '0可用，1不可用',
  `businesslicenseno` varchar(50) DEFAULT NULL COMMENT '营业执照号',
  `islogin` int(11) DEFAULT '0' COMMENT '登录存1，默认0、目前不用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=49 DEFAULT CHARSET=utf8 COMMENT='前台用户表';

