/*Table structure for table `sys_org` */

DROP TABLE IF EXISTS `sys_org`;

CREATE TABLE `sys_org` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `deleted` int(11) DEFAULT NULL COMMENT '软删除标识：0未删除，1已删除',
  `pid` int(11) DEFAULT NULL COMMENT '父id',
  `name` varchar(32) DEFAULT NULL COMMENT '组织名称',
  `createdTime` datetime DEFAULT NULL COMMENT '创建时间',
  `principal` int(11) DEFAULT NULL COMMENT '负责人id',
  `describe` varchar(300) DEFAULT NULL COMMENT '组织描述',
  `createdBy` int(11) DEFAULT NULL COMMENT '创建人id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8;

