/*Table structure for table `sys_user` */

DROP TABLE IF EXISTS `sys_user`;

CREATE TABLE `sys_user` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id主键',
  `email` varchar(50) NOT NULL COMMENT '邮箱也是登录帐号',
  `pwd` varchar(50) DEFAULT NULL COMMENT '登录密码',
  `nickName` varchar(50) DEFAULT NULL COMMENT '昵称',
  `state` int(1) NOT NULL DEFAULT '0' COMMENT '状态 0=可用,1=禁用',
  `loginCount` int(11) DEFAULT NULL COMMENT '登录总次数',
  `loginTime` datetime DEFAULT NULL COMMENT '最后登录时间',
  `deleted` int(1) NOT NULL DEFAULT '0' COMMENT '删除状态 0=未删除,1=已删除',
  `createTime` datetime DEFAULT NULL COMMENT '创建时间',
  `updateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `createBy` int(11) DEFAULT NULL COMMENT '创建人',
  `updateBy` int(11) DEFAULT NULL COMMENT '修改人',
  `superAdmin` int(1) NOT NULL DEFAULT '0' COMMENT '是否超级管理员 0= 不是，1=是',
  `orgId` int(11) DEFAULT NULL COMMENT '组织结构Id',
  `phone` varchar(11) DEFAULT NULL COMMENT '电话',
  `sex` smallint(1) DEFAULT '0' COMMENT '性别，0是女，1是男',
  `isSupplier` smallint(1) DEFAULT '0' COMMENT '是否供应商外派',
  `supplierId` int(11) DEFAULT NULL COMMENT '供应商id',
  `supplierCost` varchar(50) DEFAULT NULL COMMENT '供应商价格',
  `isAssignment` smallint(1) DEFAULT '0' COMMENT '是否外派',
  `isManager` smallint(1) DEFAULT '0' COMMENT '是否管理',
  `isLeave` smallint(1) DEFAULT '0' COMMENT '是否离职',
  `leaveTime` datetime DEFAULT NULL COMMENT '离职日期',
  `isProbation` smallint(6) DEFAULT '0' COMMENT '是否试用期',
  `qq` varchar(20) DEFAULT NULL COMMENT 'qq',
  `weixin` varchar(50) DEFAULT NULL COMMENT '微信',
  `entryTime` datetime DEFAULT NULL COMMENT '入职时间',
  `isTeamLeader` smallint(1) DEFAULT '0',
  `isVisual` smallint(1) DEFAULT '0',
  PRIMARY KEY (`id`)
